import {Axios} from "@/services/axios.js"

export default{
    RegisterUser(data){
        try {
            Axios.post('users',data)
            .then(response => {
                return response.data
            })
            .catch(e => {
                return e.messages
            })
        } catch (error) {
            return error
        }
    },
    LoginUser(data){
        try {
            Axios.post('auth/login',data)
            .then(response => {
                return response.data.token
            })
            .catch(e => {
                return e.messages
            })
        } catch (error) {
            return error
        }
    }
}
